async function loadNextListPage(){let t=document.querySelector("main"),e=document.querySelector(".next_page"),n=e.getAttribute("next");try{let s=await fetch(n);if(s.ok){let o=await s.text(),a=new DOMParser,r=a.parseFromString(o,"text/html"),n=r.querySelector("main").children;for(i=0;i<n.length;i++){let e=n[i].cloneNode(!0);t.append(e)}t.removeChild(e),n.length<5&&(t.appendChild(e),e.removeAttribute("onclick"),e.innerHTML="끝",console.log("end"))}else throw"response.ok was unsuccessful with status '"+s.statusText+" ("+s.status+")'"}catch(e){console.error(e)}}function moreLoad(){event.preventDefault(),loadNextListPage()}